import React from "react";
import "../styles/Navbar.css";
const Navbar = () => {
  return (
    <div className="header">
      <div className="h-flight">
        <div className="h-item h-home">TV-flights</div>
        <div className="h-item h-bookings">My Bookings</div>
      </div>
      <div className="h-auth">
        <div className="h-item h-auth-btn h-login">Login</div>
        <div className="h-item h-auth-btn h-register">Register</div>
      </div>
    </div>
  );
};

export default Navbar;
